import React from 'react';
import { AboutContanier } from '../Aboutpage/About.elements';
import { 
    SkillContanier, 
    SkillBox, 
    SkillTitle, 
    SkillIcon, SkillDetails, SkillDetailsHeaderWrap } from './Service.elements';
import AI from '../../assets/images/People1.png'


const Service = () => {
    return(
        <AboutContanier>
            <SkillContanier>
                <SkillBox>
                    <SkillTitle>
                        <div>
                            <SkillIcon src={AI} title="AI" />
                        </div>
                        <div>Artificial <br/> Intelligence</div>
                    </SkillTitle>
                    <SkillDetails>
                        <SkillDetailsHeaderWrap>

                        </SkillDetailsHeaderWrap>
                    </SkillDetails>
                </SkillBox>
            </SkillContanier>
        </AboutContanier>
    );
}

export default Service;
